import axios from "axios";

const config = {
    baseUrl: 'https://www.googleapis.com/youtube/v3/',
    key: 'AIzaSyCZJwDypJXsVWrNt_cfM3Qb0G_yTQXdT58'
}
export const youtubeApi = {
    getVideoList: () => {
        return axios.get(`${config.baseUrl}videos`, {
            params: {
                part: 'snippet',
                chart: 'mostPopular',
                maxResults: 25,
                key: config.key
            }
        })
    }
}
